import React, { useState, useEffect } from "react";
import Confetti from "react-confetti";

const PasswordGame = () => {
  const [password, setPassword] = useState("");
  const [isStrong, setIsStrong] = useState(false);
  const [feedback, setFeedback] = useState("");
  const [hints, setHints] = useState([]);
  const [showConfetti, setShowConfetti] = useState(false);
  const [stats, setStats] = useState({ attempts: 0, passes: 0 });

  // Load stats from localStorage when the component mounts
  useEffect(() => {
    const savedStats = JSON.parse(localStorage.getItem("passwordStats"));
    if (savedStats) setStats(savedStats);
  }, []);

  // Save stats to localStorage whenever they change
  useEffect(() => {
    localStorage.setItem("passwordStats", JSON.stringify(stats));
  }, [stats]);

  const checkPassword = () => {
    const hasLetters = /[a-zA-Z]/.test(password);
    const hasNumbersOrChars = /[0-9!@#$%^&*]/.test(password);
    const isLongEnough = password.length >= 8;

    const strong = hasLetters && hasNumbersOrChars && isLongEnough;
    setIsStrong(strong);

    if (strong) {
      setFeedback("ðŸŽ‰ Your password is strong!");
      setHints([]);
      setShowConfetti(true);
      setStats((prev) => ({
        attempts: prev.attempts + 1,
        passes: prev.passes + 1,
      }));
    } else {
      setFeedback("âŒ Try again!");
      setHints(getHints(password));
      setShowConfetti(false);
      setStats((prev) => ({
        attempts: prev.attempts + 1,
        passes: prev.passes,
      }));
    }
  };

  const getHints = (pwd) => {
    const hints = [];
    if (pwd.length < 8) hints.push("Make it longer!");
    if (!/[0-9]/.test(pwd)) hints.push("Add a number!");
    if (!/[!@#$%^&*]/.test(pwd)) hints.push("Try a special character like ! or #");
    return hints;
  };

  // Calculate success rate
  const successRate =
    stats.attempts > 0 ? ((stats.passes / stats.attempts) * 100).toFixed(1) : 0;

  // Reset stats
  const resetStats = () => {
    setStats({ attempts: 0, passes: 0 });
    localStorage.removeItem("passwordStats");
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <input
        type="password"
        value={password}
        onChange={(e) => setPassword(e.target.value)}
        placeholder="Enter a password"
        style={{ padding: "10px", fontSize: "16px" }}
      />
      <button onClick={checkPassword} style={{ marginLeft: "10px" }}>
        Test Password
      </button>

      {showConfetti && (
        <Confetti
          colors={["#ff0000", "#00ff00", "#0000ff", "#ff69b4", "#ffa500"]}
          numberOfPieces={200}
          recycle={false}
        />
      )}

      <p style={{ color: isStrong ? "green" : "red", fontWeight: "bold" }}>
        {feedback}
      </p>

      {hints.length > 0 && (
        <ul style={{ listStyle: "none", padding: 0 }}>
          {hints.map((hint, i) => (
            <li key={i} style={{ color: "orange", fontStyle: "italic" }}>
              {hint}
            </li>
          ))}
        </ul>
      )}

      {/* Stats Display */}
      <div style={{ marginTop: "30px", fontSize: "18px" }}>
        <p><strong>Attempts:</strong> {stats.attempts}</p>
        <p><strong>Passes:</strong> {stats.passes}</p>
        <p><strong>Success Rate:</strong> {successRate}%</p>

        {/* Start Over Button with hover effects */}
        <button
          onClick={resetStats}
          style={{
            marginTop: "15px",
            padding: "10px 20px",
            backgroundColor: "#ff4d4d",
            color: "white",
            border: "none",
            borderRadius: "5px",
            cursor: "pointer",
            fontWeight: "bold",
            transition: "background-color 0.3s, transform 0.2s",
          }}
          onMouseEnter={(e) => {
            e.target.style.backgroundColor = "#cc0000";
            e.target.style.transform = "scale(1.05)";
          }}
          onMouseLeave={(e) => {
            e.target.style.backgroundColor = "#ff4d4d";
            e.target.style.transform = "scale(1)";
          }}
        >
          ðŸ”„ Start Over
        </button>
      </div>
    </div>
  );
};

export default PasswordGame;
